import styles from './constructor-page.module.css';

const ConstructorPage = () => {
  return (
    <main className={styles['main']}>
      <div className={`${styles['main__menu']} ${styles['main__menu_right']}`}>
        right menu
      </div>
      <div className={`${styles['main__menu']} ${styles['main__menu_left']}`}>
        left menu
      </div> 
      <section className={styles['main__model']}>
        <div className={styles['test-block']}>
          modelf
        </div>
      </section>
    </main>
  );
};

export default ConstructorPage;
